(1, 'Register template', 'Registered Successfully', '<div style=\"max-width: 700px; min-width: 270px; margin: 0 auto; border: solid 2px #fff;\">\r\n<table style=\"padding: 15px; background-color: #[primary_color]; border-bottom: solid 5px #[secondary_color];\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\">\r\n<h1 style=\"color: #222; font-size: 23px; font-weight: 400; margin: 11px 13px 11px;\">Dear [firstName],</h1>\r\n</td>\r\n<td align=\"right\"><a href=\"[web_url]\" target=\"_blank\" rel=\"noopener\"><img src=\"[logoPath]\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div style=\"padding: 0px; font-family: Arial, Helvetica, sans-serif; color: #484848; font-size: 12px; line-height: 19px; height: auto;\">\r\n<div style=\"width: 100%; display: table;\">\r\n<div style=\"font-family: sans-serif; color: #333333; text-align: left; font-size: 13px;\">\r\n<h2>You are registered successfully!</h2>\r\n<h4 style=\"font-weight: normal;\">Welcome to the [storeName]! Now that you have created your account, you will be able to edit your account details, view your order history and discover vintage just by logging into your account. <br />[referralCode]</h4>\r\n</div>\r\n</div>\r\n<div style=\"padding: 20px 0px 0px 0px;\"><strong style=\"font-family: Source Sans Pro,Geneva,sans-serif;\">Regards,</strong><br /><strong style=\"font-family: Source Sans Pro,Geneva,sans-serif;\">[storeName]</strong></div>\r\n<br />\r\n<div style=\"font-family: sans-serif; color: #222; background: #ececec; padding: 12px; text-align: center; font-size: 13px; border-top: solid 1px #6b6b6b;\"><span style=\"font: \'Arial Black\', Gadget, sans-serif;\">Visit Us <a style=\"color: #222;\" href=\"[web_url]\" target=\"_blank\" rel=\"noopener\">[web_url]</a></span></div>\r\n</div>\r\n</div>', 1, 1, '2016-07-11 17:59:04', 1, '2018-07-27 06:53:24'),
(2, 'Success template', 'Order has been placed successfully', '<div style=\"max-width: 700px; min-width: 270px; margin: 0 auto; border: solid 2px #fff;\">\r\n<table style=\"padding: 15px; background-color: #[primary_color]; border-bottom: solid 5px #[secondary_color];\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\">\r\n<h1 style=\"color: #222; font-size: 23px; font-weight: 400; margin: 11px 13px 11px;\">Dear [firstName],</h1>\r\n</td>\r\n<td align=\"right\"><a href=\"[web_url]\" target=\"_blank\" rel=\"noopener\"><img src=\"[logoPath]\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div style=\"padding: 0px; font-family: Arial, Helvetica, sans-serif; color: #484848; font-size: 12px; line-height: 19px; height: auto;\">\r\n<div style=\"width: 98%; display: table; margin: 0 auto;\">\r\n<div style=\"font-family: sans-serif; color: #333333; text-align: left; font-size: 13px;\">\r\n<h2>Thank you for placing order!</h2>\r\n<h4 style=\"font-weight: normal;\">Your order has been placed successfully!<br /><br /></h4>\r\n</div>\r\n</div>\r\n<div style=\"font-family: sans-serif; color: #333333; text-align: center; font-size: 13px;\">\r\n<h2 style=\"font: \'Arial Black\',Gadget,sans-serif;\">Order Details</h2>\r\n</div>\r\n<table style=\"font-family: arial,sans-serif; border-collapse: collapse; width: 98%; text-align: left; border: solid 2px #d2d2d2; margin: 0 auto 15px auto;\">\r\n<tbody>\r\n<tr style=\"text-align: center; padding: 8px; border-bottom: solid 1px #d2d2d2;\">\r\n<th style=\"padding: 10px;\">Order ID</th>\r\n<th style=\"padding: 10px;\">Order Date</th>\r\n</tr>\r\n<tr style=\"background: rgba(210,210,210,0.42); border-bottom: solid 1px #d2d2d2;\">\r\n<td style=\"padding: 10px;\" align=\"center\" valign=\"top\">[order_id]</td>\r\n<td style=\"padding: 10px;\" align=\"center\" valign=\"top\">[created_at]</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n[invoice]\r\n<div style=\"padding: 20px 0px 0px 0px; width: 98%